INSERT INTO `moment` VALUES ('1709967156435','慢慢人生路','豫章故郡，洪都新府。星分翼轸(zhěn)，地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，徐孺下陈蕃(fān)之榻。雄州雾列，俊采星驰。台隍(huáng)枕夷夏之交，宾主尽东南之美。都督阎公之雅望','1709963106823','1709964349418','1709964349422','2024-03-09 06:52:36','2024-03-09 06:52:36'),('1709970780158','学家王勃创作的一篇骈文','眺望的广远，扣紧秋日，景色鲜明；再从宴会娱游写到人生遇合，抒发身世之感；接着写作者的遭遇并表白要自励志节，最后以应命赋诗和自谦之辞作结','1709966991829','1709964349418','1709964349422','2024-03-09 07:53:00','2024-03-09 07:53:00'),('1709970801046','洪都新府。星分翼轸(zhěn)，地接衡庐','主尽东南之美。都督阎公之雅望，棨(qǐ )戟(j ǐ)遥临;宇文新州之懿(yì)范，襜(chān)帷(wéi)暂驻。十旬休假，胜友如云；千里逢迎','1709963106823','1709964349418','1709964349422','2024-03-09 07:53:21','2024-03-09 07:53:21'),('1709970824150','川泽纡(yū)其骇瞩。闾(lǘ)阎(yán) 扑地','怀投笔，慕宗悫(què)之长风。舍簪(zān)笏(hù)于百龄，奉晨昏于万里。非谢家之宝树，接孟氏之芳邻。他日趋庭，叨(tāo)陪鲤对','1709964424184','1709964349418','1709964349422','2024-03-09 07:53:44','2024-03-09 07:53:44'),('1709970837130','极娱游于暇日。天高地迥','一介书生。无路请缨，等终军之弱冠;有怀投笔，慕宗悫(què)之长风。舍簪(zān)笏(hù)于百龄，奉晨昏于万里','1709903474181','1709964349418','1709964349422','2024-03-09 07:53:57','2024-03-09 07:53:57'),('1709970875677','穷岛屿之萦(yíng)回；桂殿兰宫，即冈峦之体势','原旷其盈视，川泽纡(yū)其骇瞩。闾(lǘ)阎(yán) 扑地，钟鸣鼎食之家；舸(gě)舰弥津，青雀黄龙之舳(zhú)。云销雨霁(jì)，彩彻区明','1709962703249','1709963638248','1709963638255','2024-03-09 07:54:35','2024-03-09 07:54:35'),('1709970919010','气凌彭泽之樽(zūn)；邺(yè)水朱华','九月，序属三秋。潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长洲，','1709906040181','1709963638248','1709963638255','2024-03-09 07:55:19','2024-03-09 07:55:19'),('1709970937610','钟鸣鼎食之家；舸(gě)舰弥津','。潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长洲，得天人之旧馆。层峦耸翠，上出重霄;飞阁流丹，下临无地。鹤汀(tīng)凫(fú )渚(zhǔ)，穷岛屿之萦(yíng)回','1709728097869','1709963638248','1709963638255','2024-03-09 07:55:37','2024-03-09 07:55:37'),('1709970978994','极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷','(fú )渚(zhǔ)，穷岛屿之萦(yíng)回；桂殿兰宫，即冈峦之体势。披绣闼(tà)，俯雕甍(méng )，山原旷其盈视，川泽纡(yū)其骇瞩。闾(lǘ)阎(yán) 扑地，钟鸣鼎食之家；舸(gě)舰弥津，青雀黄龙之舳(zhú)。云销雨霁','1709901189845','1709963638248','1709963638255','2024-03-09 07:56:18','2024-03-09 07:56:18'),('1709971002647','潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长','穷睇眄(dì miǎn)于中天，极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷；兴尽悲来，识盈虚之有数。望长安于日下，目吴会(kuài)于云间。地势极而南溟(míng)深，天柱高而北辰远。关山难越，谁悲失路之人;萍水','1709901682371','1709963638248','1709963638255','2024-03-09 07:56:42','2024-03-09 07:56:42'),('1709971042064','豫章故郡，洪都新府','襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，徐孺下陈蕃(fān)之榻。雄州雾列，俊采星驰。台隍(huáng)枕夷夏之交，宾主尽东南之美。都督阎公之雅望，棨(qǐ )戟','1709968946947','1709726632137','1709726632143','2024-03-09 07:57:22','2024-03-09 07:57:22'),('1709971065080','时维九月，序属三秋。潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长洲','地接衡庐。襟三江而带五湖，控蛮荆而引瓯(ōu)越。物华天宝，龙光射牛斗之墟;人杰地灵，徐孺下陈蕃(fān)之榻。雄州雾列，俊采星驰。台隍(huáng)枕夷夏之交，宾主尽东南之美。都督阎公之雅望，棨(qǐ )戟(j ǐ)遥临;宇文新州之懿(yì)范，襜(chān)帷(wéi)暂驻。十旬休假，胜友如云；千里逢迎','1709729514660','1709726632137','1709726632143','2024-03-09 07:57:45','2024-03-09 07:57:45'),('1709971086960','云销雨霁(jì)，彩彻区明。落霞与孤鹜(wù)齐飞，秋水共长天一色。渔舟唱晚，响穷彭蠡(lǐ)之滨；雁阵惊寒','穷睇眄(dì miǎn)于中天，极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷；兴尽悲来，识盈虚之有数。望长安于日下，目吴会(kuài)于云间。地势极而南溟(míng)深，天柱高而北辰远。关山难越，谁悲失路之人;萍水相逢','1709902491136','1709726632137','1709726632143','2024-03-09 07:58:06','2024-03-09 07:58:06'),('1709971113876','路出名区;童子何知，躬逢胜饯','序属三秋。潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长洲，得天人之旧馆。层峦耸翠，上出重霄;飞阁流丹，下临无地。鹤汀(tīng)凫(fú )渚(zhǔ)，穷岛屿之','1709903474181','1709726632137','1709726632143','2024-03-09 07:58:33','2024-03-09 07:58:33'),('1709971164244','云销雨霁(jì)，彩彻区明。落霞与孤鹜(wù)齐飞，秋水共长天一色。渔舟唱晚，响穷彭蠡(lǐ)之滨；雁阵惊寒，声断衡阳之浦。遥襟俯畅，逸兴遄(chuán)飞。爽籁发而清风生，纤歌凝而白云遏(è)。睢(suī)园绿竹','穷睇眄(dì miǎn)于中天，极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷；兴尽悲来，识盈虚之有数。望长安于日下，目吴会(kuài)于云间。地势极而南溟(míng)深，天柱高而北辰远。关山难越，谁悲失路之人','1709731599134','1709728495272','1709728495275','2024-03-09 07:59:24','2024-03-09 07:59:24'),('1709971184129','岂乏明时?所赖君子见机','，胜友如云；千里逢迎，高朋满座。腾蛟起凤，孟学士之词宗；紫电青霜，王将军之武库。家君作宰，路出名','1709901525538','1709728495272','1709728495275','2024-03-09 07:59:44','2024-03-09 07:59:44'),('1709971790372','岂乏明时?所赖君子见机的我i饿哦的女王范 ','穷睇眄(dì miǎn)于中天，极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷；兴尽悲来，识盈虚之有数。望长安于日下，目吴会(kuài)于云间。地势极而南溟(míng)深，天柱高而北辰远。关山难越，谁悲失路之人;萍水相逢','1709905956013','1709820642242','1709820642244','2024-03-09 08:09:50','2024-03-09 08:09:50'),('1709971810544','路出名区;童子何知，躬逢胜','时维九月，序属三秋。潦(lǎo)水尽而寒潭清，烟光凝而暮山紫。俨(yǎn)骖騑(cān fēi)于上路，访风景于崇阿(ē)；临帝子之长洲，得天人之旧馆。层峦耸翠，上出重霄;飞阁流丹，下临无地。鹤汀(tīng)凫(fú )渚(zhǔ)，穷岛屿之萦(yíng)回','1709902167810','1709820642242','1709820642244','2024-03-09 08:10:10','2024-03-09 08:10:10'),('1709971838958','十旬休假，胜友如云；千里逢迎，高朋满座。腾蛟起凤，孟学士之词宗','山原旷其盈视，川泽纡(yū)其骇瞩。闾(lǘ)阎(yán) 扑地，钟鸣鼎食之家；舸(gě)舰弥津，青雀黄龙之舳(zhú)。云销雨霁(jì)，彩彻区明。落霞与孤鹜(wù)齐飞，秋水共长天一色。渔舟唱晚，响穷彭蠡(lǐ)之滨；雁阵惊寒','1709963106823','1709820642242','1709820642244','2024-03-09 08:10:38','2024-03-09 08:10:38'),('1709971865825','岂乏明时?所赖君子见机，达人知命。老当益壮，宁移白首之心;穷且益坚，不坠青云之志','声断衡阳之浦。遥襟俯畅，逸兴遄(chuán)飞。爽籁发而清风生，纤歌凝而白云遏(è)。睢(suī)园绿竹，气凌彭泽之樽(zūn)；邺(yè)水朱华，光照临川之笔。四美具，二难并。穷睇眄(dì miǎn)于中天，极娱游于暇日。天高地迥(jiǒng)，觉宇宙之无穷；兴尽悲来，识盈虚之有数。望长安于日下，目吴会(kuài)于云间','1709902212933','1709820642242','1709820642244','2024-03-09 08:11:05','2024-03-09 08:11:05'),('1709971885974','冯唐易老，李广难封。屈贾谊于长沙，非无圣主;窜梁鸿于海曲，岂乏明时?所赖君子见机，达人知命','岂效穷途之哭!勃，三尺微命，一介书生。无路请缨，等终军之弱冠;有怀投笔，慕宗悫(què)之长风。舍簪(zān)笏(hù)于百龄，奉晨昏于万里。非谢家之宝树，接孟氏之芳邻。他日趋庭，叨(tāo)陪鲤对；今兹(苏教版为“晨”)捧袂(mèi)，喜托龙门。杨意不逢，抚凌云而自惜;钟期既(苏教版为“相”)遇','1709730058428','1709820642242','1709820642244','2024-03-09 08:11:25','2024-03-09 08:11:25');
